import math

def words_in_sentence(sentence: str) -> str:
    def is_prime(n: int) -> bool:
        if n <= 1:
            return False
        if n <= 3:
            return True
        i = 2
        while i * i <= n:
            if n % i == 0:
                return False
            i += 1
        return True

    new_lst = []
    for word in sentence.split():
        if is_prime(len(word)):
            new_lst.append(word)
    return " ".join(new_lst)
